odd.p:
's-Gravenhage en omgeving was in de periode 1818 januari-l842 september voor de heffing van de successierechten verdeeld over drie kantoren van de registratie, namelijk het eerste kantoor burgerlijke akten, het tweede kantoor burgerlijke akten en het kantoor gerechtelijke akten. De kantoren zijn in de inventaris aangeduid als respectievelijk 1e kantoor, 2e kantoor en dorpen. De verdeling over de kantoren was, onder voorbehoud, als volgt:
- 1e kantoor: 's-Gravenhage, wijken A-I en V-W;
- 2e kantoor: 's-Gravenhage, wijken K-U, en Wassenaar;
- dorpen: Rijswijk, Stompwijk, Veur, Voorburg, Zegwaard en Zoetermeer.
In de periode 1842 oktober - 1893 januari was er slechts één kantoor. Vanaf 1893 februari waren er twee kantoren. De verdeling over de kantoren was als volgt:
- 1e kantoor: 's-Gravenhage, kadastrale secties C-E, M-P en U-Z, Stompwijk, Veur en Wassenaar;
- 2e kantoor: 's-Gravenhage, kadastrale secties F-L, R en S, Nootdorp, Rijswijk, Voorburg, Zegwaard en Zoetermeer.
